L,NULL,11,'2021-06-21 07:41:05',0,NULL,NULL,NULL,'1ae76803-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(9,144,5092,7,NULL,'2021-06-21 07:41:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,98,NULL,NULL,NULL,NULL,11,'2021-06-21 07:41:05',0,NULL,NULL,NULL,'1ae768bd-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(10,144,162169,8,NULL,'2021-06-21 07:43:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Patinte heeft rustig geslapen. Been doet nog pijn, toe- of afname van roodheid niet te beoordelen omdat roodheid niet afgetekend is. Controles vanochtend: T: 38.4 C en glucose 16mmol/L. 1x bijgespoten en daarna heeft patinte goed ontbeten. Infuus is gesneuveld. Arts vragen naar thuismedicatie te kijken want patinte gebruikt thuis nog lisinopril en diclofenac en dit staat niet voorgeschreven.\r\nGlucosewaarden tot zover bekend:\r\nZondag opname: 11,6 mmol/l\r\nMaandag nuchter: 16,0 mmol/l waarop 4 EH bijgespoten \r\n\r\n- Alice V.',NULL,NULL,11,'2021-06-21 07:43:05',0,NULL,NULL,NULL,'1ae76977-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(11,144,165172,9,NULL,'2021-06-21 07:41:05',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'m3ks | instructions.default | application/pdf | cellulitis_lab2_20210702_132701_51165df6-2ead-4a13-b940-f3283763b577.pdf','Lab maandagochtend',12,'2021-06-21 07:41:05',0,NULL,NULL,NULL,'1ae76a3b-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(12,144,162169,10,NULL,'2021-06-21 09:55:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'RvO/ Cellulitis \r\n \r\nVPK/ Hoog glucose, infuus gesneuveld, nog koorts, verder geen bijzonderheden. \r\n \r\nA/ Patint meldde dat been nog wel rood en pijnlijk is; toe- of afname is onduidelijk. Nog steeds misselijkheid en tevens gebraakt. Diabetes thuis waarschijnlijk slecht gereguleerd. \r\n \r\nLO/ T 38,4C, P 88/min, RR 134/86mmHg, AH 8/min, sat 98%. Linker onderbeen nog duidelijk rood en warm, binnen afgetekende gebied (maar net afgetekend). \r\n \r\nAO/ Niet verricht. \r\n \r\nC/ Cellulitis, ontregelde diabetes en braken \r\n \r\nB/ Infuus herplaatsen (vanwege misselijkheid en braken), verder zo door. Morgen lab. \r\n\r\n- Bea Arts',NULL,NULL,12,'2021-06-21 09:55:05',0,NULL,NULL,NULL,'1ae91604-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(13,144,5088,11,NULL,'2021-06-22 07:50:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,37.5,NULL,NULL,NULL,NULL,11,'2021-06-22 07:50:05',0,NULL,NULL,NULL,'1ae918ac-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(14,144,5087,11,NULL,'2021-06-22 07:50:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,NULL,NULL,11,'2021-06-22 07:50:05',0,NULL,NULL,NULL,'1ae9197f-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(15,144,5242,11,NULL,'2021-06-22 07:50:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,NULL,NULL,11,'2021-06-22 07:50:05',0,NULL,NULL,NULL,'1ae91a58-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(16,144,5085,11,NULL,'2021-06-22 07:50:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,138,NULL,NULL,NULL,NULL,11,'2021-06-22 07:50:05',0,NULL,NULL,NULL,'1ae91b0f-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(17,144,5086,11,NULL,'2021-06-22 07:50:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,88,NULL,NULL,NULL,NULL,11,'2021-06-22 07:50:05',0,NULL,NULL,NULL,'1ae91bcb-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(18,144,5092,11,NULL,'2021-06-22 07:50:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,98,NULL,NULL,NULL,NULL,11,'2021-06-22 07:50:05',0,NULL,NULL,NULL,'1ae91c81-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(19,144,162169,12,NULL,'2021-06-22 07:55:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Geen koorts meer, glucose vanochtend 12 mmol/l was --> 1x bijgespoten. Goed gegeten, patinte braakt niet meer. Geen metoclopramide meer nodig gehad.\r\n Glucosewaarden tot zover bekend:\r\n Zondag opname: 11,6 mmol/l\r\n Maandag nuchter: 16,0 mmol/l waarop 4 EH bijgespoten\r\n Maandag voor lunch: 9,4 mmol/l\r\n Maandag voor diner: 8,7 mmol/l\r\n Maandag voor slapen: 9,9 mmol/l\r\n Dinsdag nuchter: 12,0 mmol/l waarop 2 EH bijgespoten \r\n\r\n- Alice V.',NULL,NULL,11,'2021-06-22 07:55:05',0,NULL,NULL,NULL,'1ae91d33-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(20,144,162169,13,NULL,'2021-06-22 10:10:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'RvO/ Cellulitis \r\n \r\nVPK/ Hoog glucose, koorts en braken verdwenen. \r\n \r\nA/ Patint meldde dat been misschien wel iets minder pijnlijk wordt. Voelt zich een stuk beter \r\n \r\nLO/ T 37,5C, P 82/min, RR 138/88mmHg, AH 10/min, sat 98%. Linker onderbeen nog duidelijk rood en warm, nu verder binnen afgetekende gebied dan eerder, dus afname. \r\n \r\nAO/ Inflammatieparameters dalen, kreatinine iets gestegen bij status na braken. \r\n \r\nC/ Herstellende cellulitis, regulatie diabetes verbetert. \r\n \r\nB/ Nog een dag i.v.-antibiotica, staken anti-emetica, herstarten thuismedicatie, bijspuitschema handhaven en dan inplannen ontslag. - Bea Arts',NULL,NULL,12,'2021-06-22 10:10:05',0,NULL,NULL,NULL,'1ae9d0ec-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(21,144,165172,14,NULL,'2021-06-22 14:12:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'m3ks | instructions.default | application/pdf | cellulitis_lab3_20210702_133919_95519123-3e9f-4203-968c-c231d94d4dd8.pdf','Lab dinsdag',12,'2021-06-22 14:12:05',0,NULL,NULL,NULL,'1ae9d329-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(22,144,165173,15,NULL,'2021-06-22 14:13:05',11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'m3ks | instructions.default | image/png | cellulitis_ICCDermatologie_20210702_133729_f39253bd-1bda-433e-b1d4-0cb2a8627b9b.png','Cellulitis benen',14,'2021-06-22 14:13:05',0,NULL,NULL,NULL,'1ae9d400-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(23,144,162169,16,NULL,'2021-06-22 14:21:05',11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'RvO/ Cellulitis \r\nRvC/ Gezien traag herstel antibiotica, graag uw medeboordeling bij werkdiagnose cellulitis \r\n \r\nA/ Zondag via SEH opgenomen in verband met toenemende roodheid en zwelling van het linker onderbeen. Tevens koorts. Via huisarts voorafgaand aan opname onbekend antibioticum gehad, waarschijnlijk flucoxacilline. Startdatum niet vermeld. Bij opname omgezet in flucloxacilline. Linker onderbeen is pijnlijk. Merkt nog geen duidelijke verbetering sinds opname. Vandaag ook nog koorts. \r\n \r\nLO/ Pitting oedeem linker onderbeen. Ter plaatse van het linker onderbeen doorlopend over voetrug onscherp begrensde erythemateuze macula van meerdere handpalmgrootten. Linker onderbeen warm aanvoelend.  \r\n \r\nC/ Cellulitis, gezien onscherpe begrenzing erytheem klinisch voorkeur boven klassieke erysipelas (DD indien geen verbetering denk ook aan hypostatisch eczeem, hypodermitis ikv veneuze insufficintie) \r\n \r\nB/ \r\nVoortzetten antibiotisch beleid. \r\nBij klinische verbetering start ambulante compressietherapie tot been weer slank is \r\n\r\n- J. Jeuken',NULL,NULL,14,'2021-06-22 14:21:05',0,NULL,NULL,NULL,'1ae9d4c6-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(24,144,5088,17,NULL,'2021-06-23 07:23:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,37.7,NULL,NULL,NULL,NULL,11,'2021-06-23 07:23:05',0,NULL,NULL,NULL,'1ae9d590-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(25,144,5087,17,NULL,'2021-06-23 07:23:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,80,NULL,NULL,NULL,NULL,11,'2021-06-23 07:23:05',0,NULL,NULL,NULL,'1ae9d650-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(26,144,5242,17,NULL,'2021-06-23 07:23:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,NULL,NULL,11,'2021-06-23 07:23:05',0,NULL,NULL,NULL,'1ae9d708-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(27,144,5085,17,NULL,'2021-06-23 07:23:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,130,NULL,NULL,NULL,NULL,11,'2021-06-23 07:23:05',0,NULL,NULL,NULL,'1ae9d7bb-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(28,144,5086,17,NULL,'2021-06-23 07:23:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,89,NULL,NULL,NULL,NULL,11,'2021-06-23 07:23:05',0,NULL,NULL,NULL,'1ae9d86e-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(29,144,5092,17,NULL,'2021-06-23 07:23:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,98,NULL,NULL,NULL,NULL,11,'2021-06-23 07:23:05',0,NULL,NULL,NULL,'1ae9d924-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(30,144,162169,18,NULL,'2021-06-23 08:18:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Geen bijzonderheden.  \r\nGlucosewaarden tot zover bekend  \r\nZondag opname: 11,6 mmol/l \r\nMaandag nuchter: 16,0 mmol/l waarop 4 EH bijgespoten \r\nMaandag voor lunch: 9,4 mmol/l \r\nMaandag voor diner: 8,7 mmol/l \r\nMaandag voor slapen: 9,9 mmol/l \r\nDinsdag nuchter: 12,0 mmol/l waarop 2 EH bijgespoten \r\nDinsdag voor lunch: 8,6 mmol/l \r\nDinsdag voor diner: 7,3 mmol/l \r\nDinsdag voor slapen: 7,9 mmol/l \r\nWoensdag nuchter: 8,1 mmol/l  \r\n\r\n- Alice V.',NULL,NULL,11,'2021-06-23 08:18:05',0,NULL,NULL,NULL,'1ae9d9d4-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL),(31,144,165172,20,NULL,'2021-06-23 11:44:05',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'m3ks | instructions.default | application/pdf | cellulitis_OntslagbriefInterneGeneeskunde_20210702_134436_4ca1c250-d9b3-4838-a6e0-93734f4970ee.pdf','Ontslagbrief',12,'2021-06-23 11:44:05',0,NULL,NULL,NULL,'1aea875d-aacc-11ec-958b-005056bc15d1',NULL,NULL,'FINAL',NULL);
